window.bookSummaryJSON = "<p><b>Speed, surprise, and aggression... Hit on Jackpot is go. </b></p> <p>The scourge of the Savage Lands, an ancient dragon allied to a gathering storm of dark forces threatening the world of Ruin, becomes the next target of the most fearsome shock troops ever conceived, prepared, and trained for total war: US Army Rangers.&nbsp;</p> <p>Deep beneath a once-fantastic ruined empire, a creature more terrible, diabolical, and malevolent than any myth ever told lies atop a vast horde of wondrous treasure and deadly magic, dreaming dreams of greed and terror. The Rangers of the Ruin will thread the dangerous trap-laden depths of a deadly desolation sinking into a foul swamp in order to get their hit on the ancient prize.&nbsp;</p> <p>But be warned, the fight you pick with Rangers is going to be the last fight you pick.&nbsp;</p> <p>It's Rangers vs. Dragon as the saga of Forgotten Ruin continues! Audiobook also includes after-action report with authors and Ranger quality-control advisors!</p>"; 
